    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 16 + col1 IN ( + - col1, ( + 47 ), + + col2 + - col2 * - + 52 );
  - name: tab2

outputs:
  - name: q7133.out
    data: |
      46	51	23
      64	77	40
      75	67	58
